import React from "react";
import "./Header.css";
import {Link} from "react-router-dom";

function Header(){

    return (
        <nav className="header">
            <Link to="/">
                <img className="header__logo"
                     src={require("../images/logo.png")}
                     alt="" />
            </Link>

        </nav>
    )
}
export default Header;
